import React from 'react';

export default function BasicFocusTrap() {
  const [open, setOpen] = useState(false);

  return (
    <Box sx={{ display: 'flex', alignItems: 'center', flexDirection: 'column' }}>
      <button type="button" onClick={() => setOpen(true)}>
        Open
      </button>
      {open && (
        <div>test</div>
      )}
    </Box>
  );
}
